  JWILLIAMS, Cyril Nelson Beetham and WILDER, Maud Margaret (Pearlie)
  JWILLIAMS, Patricia Wilder and KELLY, George Murray Swinburne
  JKELLY, Teresa Mary and FRASER, Clyde Edward George
  IFRASER, Deborah (Debbie) and HARVEY, Simon
  Mariargaret Pearlie)
  01> FRASER, Deborah (Debbie) m on 21.03.1992 to HARVEY, Simon
  b 11.05.1970
  b ** ** ****
  Deborah m, at Glayva. Address: Sydney, Australia.
  Debbie is a travel consultant and Simon is a sales and marketing manager for an engineering firm.
  b2> FRASER, David
  b 26.07.1971
  03> KELLY, Teresa Mary de facto (2) MORRISON, Roderick Charles
  Malcolm
  b 19.08.1949
  b 30.05.1943
  Address: "Glayva", RD 14, Havelock North.
  Teresa is a community service manager for the Intellectually Handicapped Children's Society. Teresa
  bought "Glayva", an 18 acre orchard in 1981 which she and Rod ran together. They sold it in 1990 and
  moved to an eight acre lifestyle block near Elsthorpe, retaining the name, "Glayva".
  04> KELLY, Elizabeth Janet and TAYLOR, Michael
  b 31.10.1951
  b 18.07.1949
  Elizabeth b. at Hastings. Michael, s/o Albert Taylor and Patricia Simpson, b. at Preston, Selford,
  England. Address: 30 Wiremu Street, Auckland 4.
  Elizabeth was educated at Ruakawa School, Queenswood Rudolph Steiner School and Woodford House. She
  graduated BA from the University of Canterbury in 1973 and in 1974 she obtained a London Chamber of
  Commerce Private Secretary's Certificate from Guildford Technological College in Surrey, England.
  Michael emigrated to New Zealand in 1962 and was educated at Horowhenua College. He obtained a
  DipFA(Hons) from the University of Auckland (Elam) in 1972, a DipTchg from Auckland Teachers' College
  in 1972 and a Diploma from the New Zealand Library School, Wellington, in 1976.
  Elizabeth has worked in publishing, bookselling and tertiary education. She has been at the Auckland
  Institute of Technology since 1988 and is currently the Registrar for the Faculty of Arts. Michael
  taught art after graduating from training college, and has been a librarian and practising artist since
  1977.
  01> TAYLOR, Grace
  b 01.11.1980
  05> WILLIAMS, Timothy John Wilder m on ** 11.1943 to (1) FOWLER, Patricia Faith
  b 21.08.1915 d 08.01.1979
  b 29.12.1920 d 05.11.1962
  Timothy b. at Napier. Patricia bd. at Elsthorpe.
  Tim attended Christ's College (shooting VIII 1932-33) and farmed at "Aramutu"
  station (formerly part of "Atua"), Elsthorpe. He was a Pilot Officer in WW2 flying
  bombers over Europe and transports to the Middle East and was awarded the DFC and
  Bar. Pat was head prefect at Wellington Diocesan School for Girls.
  01> WILLIAMS, Mark Antony m on 23.01.1970 to HELMORE, Victoria Frances
  b 11.12.1945
  b 29.01.1946
  Mark b. at Hastings and m. at Crownthorpe, Hawkes Bay, Victoria, d/o John Desmond Helmore and Deirdre
  Frances Williams. Address: Black Dog Cottage, RD 14, Havelock North.
  Mark was educated at Hereworth School and Christ's College and is a farmer on "Aramutu" station.
